// Solution 2:
const moveElementToEnd = (array, toMove) => {
    let i = 0;
    let j = array.length - 1;

    while (i < j) {
        if (array[j] === toMove && array[i]!== toMove) {
            [array[i], array[j]] = [array[j], array[i]];
            i++;
            j--;
        } else if (array[j]!== toMove) {
            j--;
        } else if (array[i] === toMove) {
            i++;
        }
    }

    return array;
};

